    }
  }, [dispatch, pathname, isAuth, navigete, planId]);

  return (
    <Routes>
      <Route path="/" element={<Layout />}>

        {/* 로그인 한 사람만 갈 수 있는 경로 */}
        <Route element={<ProtectedRoutes />}>

        </Route>



        <Route element={<NotAuthRoutes />}>
          <Route path="login" element={<Login />} />
          <Route path="signup" element={<Signup />} />
        </Route>
      </Route>

    </Routes>
  );
};

export default App;
